import React from 'react'


const ClientRegistration = (props)=>{
return(
   <>
    <div className='client-container'>
        <div>
        <input
         type="text"
         placeholder='Client Id#' 
         name='id'
         value = {props.id}
         onChange = {props.changeHandler}
         
        />
        <input
         type="text"
         placeholder='Client Name' 
         name='clientData'
         value={props.clientData.name}
         onChange = {props.changeHandler}
        />

        <input
         type="number"
         placeholder='Mobile No'
         name='clientData'
         value = {props.clientData.mobile} 
         onChange = {props.changeHandler}
        />

        <input
         type="text"
         placeholder='Client Address' 
         name='clientData'
         value = {props.clientData.address}
         onChange = {props.changeHandler}
        />
        <button onClick={props.registration}>Register</button>
        </div>
        <div>The result id{props.clientData.name},{props.clientData.mobile}</div>
    </div>
   </>
)
}

export default ClientRegistration;
